from math import sqrt, ceil
class Solution(object):
	def numSquares(self, n):
		n += 1
		m = int(sqrt(n))
		dp = [1 << 31] * n
		dp[0] = 0
		dp[1] = 1
		for i in xrange(2, n):
			for j in xrange(1, int(sqrt(i)) + 1):
				dp[i] = min(dp[i], dp[i - j * j] + 1)
		return dp[n - 1]

